import modelData from './homeModel';
import HeroBanner from '../../components/HeroBanner/HeroBanner';
import Panel from '../../components/Panel/Panel';
const Home = () => {
  const { heroBanner } = modelData;
  return (
    <div>
      <HeroBanner {...heroBanner}></HeroBanner>
    </div>
  );
};
export default Home;
